import React,{Component} from 'react';
import Header from './header'
import Search from './Search'
import {GlobalStyle} from './style'
import {IconfontStyle} from './common/iconfont/iconfont'

class App extends Component{
  render(){
    return(
      <div>
      <GlobalStyle/>
      <IconfontStyle/>
      <Header/>
      <Search/>
      </div>
    )
  }
}

export default App;
